import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import 'semantic-ui-css/semantic.min.css'

const [cityData, setCityData] = useState([]);
const [cities, setCities] = useState([]);

function getCitiesList() {
  const countryURL = 'https://api.openaq.org/v1/cities';

  fetch(countryURL)
    .then(response => response.json()).then(data => { setCityData(data.results) });
  getCityNames();
}

function getCityNames() {
  let cityNames = [];
  cityData.forEach(item => cityNames = [...cityNames, item.name]);
  setCities(cityNames);
  console.log(cities);
}
ReactDOM.render(

  <App />,
  document.getElementById('root')
);

